function add_bossnpc(Tab6)
	for i = 1 , getn(Tab6) do
		Tid = SubWorldID2Idx(Tab6[i][3]);
		if (Tid >= 0 ) then
			TabValue4 = Tab6[i][4] * 32
			TabValue5 = Tab6[i][5] * 32
			newtasknpcindex = AddNpc(Tab6[i][1],Tab6[i][2],Tid,TabValue4,TabValue5,Tab6[i][6],Tab6[i][7],Tab6[i][8]);
			SetNpcScript(newtasknpcindex, Tab6[i][9]);
			SetNpcParam( newtasknpcindex,1,Tab6[i][10]);
		end;
	end;
end;

function add_messengernpc(Tab4)
	for i = 1 , getn(Tab4) do
		Tid = SubWorldID2Idx(Tab4[i][3]);
		if (Tid >= 0 ) then
			newtasknpcindex = AddNpc(Tab4[i][1],Tab4[i][2],Tid,Tab4[i][4],Tab4[i][5],Tab4[i][6],Tab4[i][7],Tab4[i][8]);
			SetNpcScript(newtasknpcindex, Tab4[i][9]);
		end;
	end;
end;

